TO BE A PRO ATHLETE YOU NEED TO GET 💰!!! Not just winning the meet! Most big pro meets maybe a few lifters get paid!  which is great when I started powerlifting in 2007 no way u got paid! We want to bring the best production! We trying to get the pros paid just for showing up! A lot like boxing. Most boxers make most there money on tickets sales. Sure we won’t be getting crazy money to the pros but it’s a start.  Some pros will get more then others! Depends on who is pushing ticket sales! I’m very excited for this. I personally know what it cost to do a pro level meet. It’s not cheap. January 1 tickets go live. It’s been a dream of mine as a kid to host events. Were in a place to host one the coolest event yet. I feel blessed but also grateful to give back to the sport that saved my life. I want everyone to win. I am at times speechless just to be where I am. Let’s see what we can do at the AMP2 

@steff_eff15 
