🔥🔥 We are 6 days out from @the_american_pro_ 2! OMG where did time go. @ana_smash and our whole team been planning this event since last July!  We personally wanna say thank you to all the sponsors getting involved with this event! Truly means the world! This event is by far the hardest event to plan. Ana and myself and our whole team countless calls and emails. Here we are man. 

Thank you to all the lifters who trusted in our event! We promise this year is going top last year!!! Let’s have some fucking fun. See y’all in the arena!!!!! 

Huge thank you from and and myself to our head of staff managing their rolls and making sure we are ready to rock. We love y’all. 

