@the_american_pro_  2 is officially over!!! It’s sad to see it end! 

@tongan_david99 our platform manger dude wow thank you 3 fucking days 2 seasions. You did a great job with your team. Most don’t know but a meet isn’t run with out a great spotter crew

@barbell_al our head of ref manger thank you for building a great team of judges. Judging on this level is the scariest thing and to make them tough calls isn’t easy. I believe this team was perfect. 

@xtinakatarina head of our warm up room manager thank you for making sure the a warm up room was taken care of and the lifter in there. This made the meet a lot smoother. Thank you so much. 

@kr_ss our lifting cast manager and pretty much my right hand woman for meets . It’s not easy being by my side day in and day out but somehow you always stay around and you always have my back and always keep things together this meet and every meet wouldn’t have been what it was with our u. U are so amazing to me. Thank you. 

My fam who made this trip to help. I know I’m a ass whole most the time but just know you all being here made me so much happier even tho it may not seemed like it. I truly love you guys.I truly don’t believe I could have made this trip with out u all. 

@ana_smash the co founder of this event.  We did it man. We may not be perfect but I can say we are a damn good team! Thank you for trusting me as much as you do. Thank you for picking me to be ur partner in this event it’s stressful and the pressure of this event is somthing I can’t really describe but man I truly believe we did somthing no in will forget. Thank you Ana for picking me and asking me to help with this event. Thank you for going outside ur comfort zone and standing with me on the red carpet. You came into my world as just a person asking to run a meet now u become my friend.

 our staff wow it’s craxy to know last year we couldn’t find help we run the pro 1 with less then 10 Staff members this year we had a army. This meet was run the way it was bc of y’all thank you so much. U are the army we needed! 

Lifters  thank you for picking the amp 2. We truly hope we hold up on our end. We truly just want you’ll having fun! 

